import React from "react";

function MobilePage() {
    return (
        <div className="mobile-page">
            <p>To use Guitar Scale Finder on mobile, download the iOS app (free, no ads)</p>
            <a className="mobile-app-store-link" rel="noopener noreferrer" href="https://apps.apple.com/us/app/guitar-scale-finder/id1487884068" target="_blank">Guitar Scale Finder on the App Store</a>
            <p>Otherwise, come back on a laptop or desktop</p>
            <a className="mobile-email-link" rel="noopener noreferrer" href="mailto: guitarscalefinder@gmail.com" target="_blank">Contact: guitarscalefinder@gmail.com</a>
        </div>
    );
}

export default MobilePage
